import React from 'react';
import { Link } from 'react-router-dom';

const ReportScreen = () => {
    return ( 
        <div className="w3-container w3-light-gray" style={{width: '100%',marginBottom: '10em',padding:0,fontSize: '1.2em'}}>
          <div className="">
            <div className="w3-margin-top w3-margin-left"><Link to="/dashboard"><i className="material-icons">arrow_back</i></Link></div>
            <div className="w3-container w3-center w3-light-gray" style={{
                  paddingLeft: '1em', paddingRight: '1em', margin:'0  1em 1em 1em'
                }}>
          <div className="w3-cell">
            <img src="https://www.w3schools.com/w3css/img_avatar3.png" alt="Avatar" className="w3-circle" style={{ width: '60px' }} />
          </div>
          <div className=" w3-container w3-cell ">
            <p className="" style={{margin:'0.8em 1em 1em 1em'}}>
                <b>Harikrishna's Creativity</b>
            </p>
          </div>
          </div>
        </div>
        <div className="w3-container w3-white" style={{ padding: 0,borderRadius: '25px 25px 0 0'}}>
</div>
        </div>
     );
}

export default ReportScreen;
